import styles from "./Footer.module.css";

const Footer = () => {
  return (
    <div className={styles.container}>
      <h1>jorhedev</h1>
      <footer>
        <p>Derechos de autor © 2023. Mi sitio web.</p>
        <p>Contáctanos en info@misitioweb.com</p>
      </footer>
    </div>
  );
};

export default Footer;
